<?php
// replace image variables (placeholders) using a base64 image. The placeholder has been added to the alt text content

require_once dirname( __FILE__ ) . '/../../../Classes/Phpxlsx/Create/CreateXlsx.php';

$xlsx = new Phpxlsx\Create\CreateXlsxFromTemplate('../../files/templates.xlsx');

$imageBase64 = 'data:image/png;base64,';

// replace image in sheets target
$xlsx->replaceVariableImage(array('IMAGE_1' => $imageBase64));

// replace image in headers target
$options = array(
	'target' => 'headers',
);
$xlsx->replaceVariableImage(array('IMAGE_HEADER' => $imageBase64), $options);

// replace image in footers target
$options = array(
	'target' => 'footers',
);
$xlsx->replaceVariableImage(array('IMAGE_FOOTER' => $imageBase64), $options);

$xlsx->saveXlsx('example_replaceVariableImage_4');